import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "transparent",
    },
    title: {
        fontSize: 24,
        fontWeight: "bold",
        marginBottom: 20,
    },
    input: {
        width: 500,
        height: 50,
        fontSize: 18,
        padding: 10,
        margin: 10,
        borderColor: "#062A52",
        borderWidth: 2,
        borderRadius: 5,
        backgroundColor: "white",
    },
    button: {
        width: 100,
        height: 50,
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#062A52",
        borderRadius: 5,
        marginTop: 20,
    },
    buttonText: {
        color: "white",
        fontSize: 20,
        fontWeight: "bold",
    },
    errorText: {
        color: "red",
        fontSize: 16,
        marginTop: 10,
    },
});

export default styles;
